				MimeUtility.encodeText(inlineFilename) : inlineFilename);
		}
		catch (UnsupportedEncodingException ex) {
			throw new MessagingException("Failed to encode inline filename", ex);
		}
	}
	getMimeMultipart().addBodyPart(mimeBodyPart);
}

